    $("#btn3").css("visibility", "visible");
    $("#btn8").css("visibility", "visible");
    $("#btn9").css("visibility", "visible");
    $(".Layer").css("transition", "all 2s");
    $(".Layer").css("width", "25px");
    $(".Layer").css("margin-left", "0px");
